  data as completely and accurately as possible (given existing time and resource
  constraints), the USFWS gives no warranty, expressed or implied, as to the accuracy,
  reliability, or completeness of these data. In addition, the USFWS shall not be
  held liable for improper or incorrect use of the data described and/or contained
  herein. Graphical representations provided by the use of this data do not represent
  a legal description of the critical habitat boundary. The user is referred to the
  critical habitat textual description in the appropriate final rule for this species
  as published in the Federal Register. These data are to be used only in the context
  of the definition and purpose of critical habitat. This primarily relates to Section
  7 consultation under the Endangered Species Act. These data may be used for planning
